class StateClass extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            message: "Welcome to React Js"
        }

    }
    render(){
        return <div>
            <h1>{this.state.message}</h1>
            <br/>
            <br/>
            <br/>
            <button>Click to proceed</button>
        </div>


    }

}



export default StateClass;
